        const fetchdata=()=>{
            const response = coinGecko.get("/coins/markets",{
                params: {
                    vs_currency: "inr",
                    ids: "bitcoin,etherium"
                }
            })
            console.log(response.data)
        }
        fetchdata();
    },[])
